'''Olivier Bonnaire''' (born March 2, 1983 in [[Le Quesnoy]]) is a [[France|French]] [[road bicycle racer]] who last rode professionally for [[UCI Professional Continental]] team {{ct|FDJ|2011}}. He returned to cycling as an amateur in 2013 when he rode for the Entente Cycliste Vieux Condé-Péruwelz-Bury team. He is a cousin of racing cyclists [[David Lefèvre]], [[Laurent Lefèvre]]<ref name=vcpb>{{cite web |url=http://www.lavoixdunord.fr/region/olivier-bonnaire-vient-renforcer-l-entente-cycliste-vieux-jna27b0n946355 |title=Olivier Bonnaire vient renforcer l'Entente Cycliste Vieux Condé-Péruwelz-Bury |author=<!--Staff writer(s); no by-line.--> |date=9 January 2013|website=[[La Voix du Nord (daily)]]|language=French |trans-title=Olivier Bonnaire strengthens Entente Cycliste Vieux Condé-Péruwelz-Bury|accessdate=5 August 2014}}</ref> and [[Marion Rousse]].<ref>{{cite web |url=http://www.lottobelisol.be/en/team.htm?n=142&naam=Marion+Rousse&pId=150 |title=Marion Rousse |author=<!--Staff writer(s); no by-line.-->|website=[[Lotto Belisol Ladies]] |accessdate=5 August 2014}}</ref>

