'''Dimitri Champion''' (born 6 September 1983 in [[La Rochelle]]) is a [[France|French]] former [[road bicycle racer]], who rode professionally between 2007 and 2012 for the {{ct|BBO|2008}}, {{ct|ALM|2011}} and {{ct|FST|2012}} squads. He was best known for winning the [[French National Road Race Championships]] in 2009.
