'''Pierre Drancourt''' (born May 10, 1982 in [[Maubeuge]]) is a [[France|French]] [[road bicycle racer]] for ESEG Douai, a French amateur team. He has previously competed for professional teams {{ct|BBO|2007}}, Groupe Gobert.com and {{ct|RLM|2012}}.<ref>{{cite web|url=http://62.50.72.82/ucinet/default.asp?page=UCITeamsdetail&discipline=ROA&continent=ALL&teamscategory=CTM&teamstype=CTM&year=2012&teamnameid=3465&npage=3&search=&l=ENG|title=Roubaix Lille Metropole (RLM) - FRA|accessdate=27 January 2012|work=[[UCI Continental Circuits]]|publisher=[[Union Cycliste Internationale]]}}</ref>

