'''Yohann Gène''' (born 25 June 1981 in [[Pointe-à-Pitre]], [[Guadeloupe]]) is a [[France|French]] former professional [[road bicycle racer]], who competed professionally between 2005 and 2019, entirely for {{ct|BBO|2005}} and its later iterations.<ref>{{cite news|url=https://www.lequipe.fr/Cyclisme-sur-route/Actualites/Yohann-gene-arretera-sa-carriere-a-la-fin-de-la-saison/1027387|title=Yohann Gène arrêtera sa carrière à la fin de la saison|language=French|trans-title=Yohann Gene to end his career at the end of the season|work=[[L'Équipe]]|publisher=[[Éditions Philippe Amaury]]|date=8 June 2019|accessdate=12 January 2020}}</ref> He was the first cyclist of Afro-Caribbean and Sub-Saharan African descent to ever compete in the [[Tour de France]].<ref>{{cite news| url=http://www.time.com/time/world/article/0,8599,2082253,00.html | work=Time | title=Breaking News, Analysis, Politics, Blogs, News Photos, Video, Tech Reviews - TIME.com | date=9 July 2011}}</ref>
