{{Infobox protected area | name = Radal Siete Tazas National Park | iucn_category = II | photo = Parque_Nacional_Radal_Siete_Tazas_(3).jpg | photo_caption = The Seven Cups | location = [[Maule Region]], [[Chile]] | nearest_city = [[Molina, Chile|Molina]] | area = {{convert|41.4|km2|acre|abbr=on}}<ref name="CONAF"> {{cite web |title=Parque Nacional Radal Siete Tazas |url= http://conaf.cl/parques/ficha-parque_nacional_radal_siete_tazas-42.html| publisher=[[CONAF]] |language=Spanish |accessdate=2014-01-03}}</ref> | established = | visitation_num = | visitation_year = | governing_body = [[Corporación Nacional Forestal]] }}
[[File:SaltoDeLaLeona.JPG|thumb|200px|Waterfall Salto de la Leona.]] [[File:PozonesRioClaro.jpg|thumb|200px|Pools along the river Claro.]] '''Radal Siete Tazas National Park''' ({{IPA-es|raˈðal ˈsjete ˈtasas}}) is a [[national park]] located in [[Curicó Province]], [[Maule Region]], [[Chile]]. It lies in a pre-[[Andean]] area close to [[Descabezado Grande]] volcano.
==History== This protected area was reclassified as a national park in 2008.<ref name="CONAF"/>
After the [[2010 Chile earthquake|February 27, 2010 earthquake]] one of the park's main attraction, the Seven Cups, completely dried up. It is believed a rock [[Fracture (geology)|fissure]] allowed the water to empty into an [[aquifer]].
==Geography== The park's most popular feature is the area known as ''Siete Tazas'' (Seven Cups), which consists of seven consecutive natural pools with their respective waterfalls along [[Claro River (Maule)|Claro River]]. These waterfalls range from 1 to 10.5 metres. There are also two high waterfalls called ''El Velo de Novia'' (The Bridal Veil) and ''La Leona'' (The Lioness), with single vertical drops of 40 and 20 metres respectively. Many kayakers paddle the smaller falls ranging from 1 to 10.5 metres (3–32 feet). Once kayakers enter the steep canyon the only way out is down. Many tourists congregate on platforms surrounding the canyon to watch the kayakers as they navigate the waterfalls. At the end of the run kayakers must make a quick move to shore in order to avoid the 40 meter waterfall. This is the end of the canyon where kayakers then hike out.
The park's elevations range from {{convert|650|m|ft|abbr=on}} to {{convert|2600|m|ft|abbr=on}}.<ref name="CONAF"/>
==Biology== The park protects tree species mainly of the genus ''[[Nothofagus]]'', including the threatened ''[[Nothofagus glauca]]'' and ''[[Nothofagus leonii]]'', as well as ''[[Nothofagus macrocarpa]]'', ''[[Nothofagus dombeyi]]'', ''[[Nothofagus antarctica]]'' and ''[[Nothofagus alpina]]''. Also it is possible to find vulnerable and rare species, as are ''[[Austrocedrus chilensis]]'' and ''[[Maytenus chubutensis]]''.
The park is home to an endangered subspecies of ''[[Cyanoliseus patagonus]]'' known locally as ''Tricahue''.
