{{short description|French cyclist}} {{Infobox cyclist | name = Arnaud Labbe | image = Arnaud Labbe.jpg | caption = | fullname = Arnaud Labbe | nickname = | birth_date = {{birth date and age|1976|11|3|df=y}} | birth_place = [[Creil]], [[France]] | height = 1.83 m | weight = 73 kg | currentteam = CC Périgueux Dordogne | discipline = Road and cyclo-cross | role = Rider | ridertype = | amateuryears1 = 2001 | amateurteam1 = Cycle Poitevin | amateuryears2 = 2010 | amateurteam2 = GSC Blagnac | amateuryears3 = 2014– | amateurteam3 = CC Périgueux Dordogne | proyears1 = 2005 | proteam1 = {{ct|AUB|2005}} | proyears2 = 2006–2009 | proteam2 = {{ct|BBO|2006}} | proyears3 = 2010–2013 | proteam3 = {{ct|COF|2010}} | majorwins = }}
'''Arnaud Labbe''' (born 3 November 1976 in [[Creil]], [[Oise]]) is a [[France|French]] [[racing cyclist]] who rides for the CC Périgueux Dordogne team.<ref name="CCPD">{{cite news|url=http://www.directvelo.com/actualite/30748-arnaud-labbe-au-cc-perigueux-dordogne.html|title=Arnaud Labbe au CC Périgueux Dordogne|language=French|trans-title=Arnaud Labbe with CC Périgueux Dordogne|work=Directvelo|publisher=Association Le Peloton|date=18 November 2013|accessdate=24 December 2013|first=Nicolas|last=Gachet}}</ref> He had started the 2010 season riding for an amateur team, GSC Blagnac, having failed to earn a renewal of his contract with {{ct|BBO|2009}} at the end of the previous season, but {{ct|COF|2010}} were left short of riders due to injuries and illness, and needed to expand their squad.<ref>[http://www.cyclingnews.com/news/cofidis-signs-labbe-as-it-struggles-to-fill-rosters Cofidis signs Labbe as it struggles to fill rosters]</ref> Labbe competes in [[road bicycle racing|road]] and [[cyclo-cross]] events.
For the 2014 season, Labbe returned to the amateur ranks with CC Périgueux Dordogne.<ref name="CCPD"/>
