{{short description|Dutch actress}} {{Use dmy dates|date=August 2016}} {{Infobox person | name = Monic Hendrickx | image = MonicHendrickx2019a.jpg | birth_date = {{Birth date and age|1966|12|3|df=yes}} | birth_place = [[Sint Anthonis]], [[Netherlands]] | residence = | nationality = [[Dutch people|Dutch]] | occupation = [[actor|Actress]] | years_active = 1998–present }} '''Monic Hendrickx''' (born 3 December 1966 in [[Sint Anthonis]]) is a [[Netherlands|Dutch]] actress. She has won several awards during her career including four [[Golden Calf (award)|Golden Calf]] awards for Best Actress at the [[Nederlands Film Festival]], the Jury Award at the 2001 [[Newport Beach Film Festival]] and the Best Actress Award at the 1999 [[Buenos Aires International Festival of Independent Cinema]].
==Early life==
Monic Hendrickx was born in 1966 in the Netherlands.<ref name="rfwe9">{{cite web |title=HOME > FILM STARS > MONIC HENDRICKX MONIC HENDRICKX |url=https://www.biosagenda.nl/p8262_monic-hendrickx.html |website=Biosagenda NL |publisher=Biosagenda NL |accessdate=10 September 2018}}</ref> At the age of three, her and her family moved to Paramaribo.<ref name="rfwe9">{{cite web |title=HOME > FILM STARS > MONIC HENDRICKX MONIC HENDRICKX |url=https://www.biosagenda.nl/p8262_monic-hendrickx.html |website=Biosagenda NL |publisher=Biosagenda NL |accessdate=10 September 2018}}</ref> Eventually Hendrickx started her acting education at Toneelschool in Maastricht.<ref name="rfwe9">{{cite web |title=HOME > FILM STARS > MONIC HENDRICKX MONIC HENDRICKX |url=https://www.biosagenda.nl/p8262_monic-hendrickx.html |website=Biosagenda NL |publisher=Biosagenda NL |accessdate=10 September 2018}}</ref>
