{{Automatic taxobox | image = Chlorella vulgaris NIES2170.jpg | image_caption = ''[[Chlorella vulgaris]]'' | taxon = Trebouxiophyceae | authority = Friedl, 1995<ref>{{cite journal | last1 = Friedl | first1 = T | year = 1995 | title = Inferring taxonomic positions and testing genus level assignments in coccoid green lichen algae: a phylogenetic analysis of 18S ribosomal RNA sequences from Dictyochloropsis reticulata and from members of the genus Myrmecia (Chlorophyta, Trebouxiophyceae cl. nov.) | url = | journal = Journal of Phycology | volume = 31 | issue = 4| pages = 632–639 | doi=10.1111/j.1529-8817.1995.tb02559.x}}</ref> | subdivision_ranks = Orders | subdivision_ref = <ref name="Algaebase">{{cite web | url = http://www.algaebase.org/browse/taxonomy/?id=4356 | publisher = AlgaeBase version 4.2 World-wide electronic publication, National University of Ireland, Galway | accessdate = 2007-09-23 | title = Class: Trebouxiophyceae taxonomy browser |author1=Guiry, M.D. |author2=Guiry, G.M. |lastauthoramp=yes | year = 2007 }}</ref> | subdivision = * [[Chlorellales]] * [[Microthamniales]] * [[Phyllosiphonales]] * [[Prasiolales]] * [[Trebouxiales]] }}
The '''Trebouxiophyceae''' are a [[class (biology)|class]] of [[green algae]], in the division [[Chlorophyta]].<ref name="Algaebase"/> Their circumscription within the green algae is not well established due to the need for more genetic studies at higher levels within the group.{{citation needed|date=October 2014}}
Genera without intervening taxonomy include: * ''[[Choricystis]]'' * ''[[Crucigenia]]'' * ''[[Koliellopsis]]'' * ''[[Leptosira]]'' * ''[[Rhopalosolen]]'' * ''[[Viridiella]]'' * ''[[Prototheca]]''
