{{short description|French cyclist}} {{Infobox cyclist | name = Rony Martias | image = Rony Martias.jpg | fullname = Rony Martias | nickname = | birth_date = {{Birth date and age|1980|8|4}} | birth_place = [[Basse-Terre]], [[Guadeloupe]], [[France]] | height = {{height|m=1.81|precision=0}} | weight = {{convert|71|kg|lb|abbr=on}} | currentteam = UC Cholet 49 | discipline = Road | role = Rider | ridertype = | amateuryears1 = 2002 | amateurteam1 = {{ct|EUC|2002}} ''(stagiaire)'' | amateuryears2 = 2014– | amateurteam2 = UC Cholet 49 | proyears1 = 2003–2009 | proteam1 = {{ct|EUC|2003}} | proyears2 = 2010–2013 | proteam2 = {{ct|SAU|2010}} | majorwins = }}
'''Rony Martias''' (born August 4, 1980 in [[Basse-Terre]], [[Guadeloupe]]) is a [[France|French]] [[road bicycle racer]] for the UC Cholet 49 amateur team.<ref name="Cholet">{{cite news|url=http://www.directvelo.com/actualite/30895-rony-martias-a-l-uc-cholet-49.html|title=Rony Martias à l'UC Cholet 49|language=French|trans-title=Rony Martias at UC Cholet 49|work=Directvelo|publisher=Association Le Peloton|first=Nicolas|last=Gachet|date=29 November 2013|accessdate=25 December 2013}}</ref> Martias previously competed as a professional between 2003 and 2013, for the {{ct|EUC|2009}} and {{ct|SOJ|2013}} squads.
After {{ct|SOJ|2013|nolink=yes}} folded at the end of the 2013 season, Martias returned to the amateur ranks with UC Cholet 49.<ref name="Cholet"/>
