'''Alexandre Pichot''' (born 6 January 1983) is a [[France|French]] former professional [[road bicycle racer]], who competed professionally between 2006 and 2019, entirely for the {{ct|BBO|2006}} team and its later iterations.<ref>{{cite news|url=https://www.ouest-france.fr/sport/cyclisme/cyclisme-l-ornais-alexandre-pichot-arretera-sa-carriere-l-issue-de-paris-tours-6550014|title=Cyclisme. L'Ornais Alexandre Pichot arrêtera sa carrière à l'issue de Paris-Tours|language=French|trans-title=Cycling. The Ornais Alexandre Pichot will stop his career at the end of Paris-Tours|date=4 October 2019|accessdate=12 January 2020|first=Christophe|last=Richard|work=[[Ouest-France]]|publisher=Groupe Ouest-France}}</ref>
