The '''Lone Star Card''' is an [[Electronic Benefit Transfer]] pin-based card. The card is used for [[Food Stamp]] and [[Temporary Assistance for Needy Families]] programs for the [[Texas|State of Texas]], [[United States|United States of America]]. When the program was implemented in 1995 the system became and still remains the largest [[Electronic Benefit Transfer|EBT]] system in the [[United States|United States of America]]. However this distinction is shared with [[New York (state)|New York]] state, alternating the position year to year.<ref>[http://www.hhsc.state.tx.us/providers/LoneStar/EBT/EBThistory.html EBT History Page<!-- Bot generated title -->] {{webarchive|url=https://web.archive.org/web/20071026052735/http://www.hhsc.state.tx.us/providers/LoneStar/EBT/EBThistory.html |date=2007-10-26 }}</ref>
